  DBMS_DATA_MINING.CREATE_MODEL('NN_CLASS_MODEL3', 'CLASSIFICATION', 'TRAIN_DATA_CLAS', 'CUST_ID',' AFFINITY_CARD', 'N1_BUILD_SETTINGS');
